import File from './File';


class App extends React.Component {

    render() {
        return(
            <div> 
            <File name = 'Samer' name2= 'Gharbi'/>
            <File name = 'Majid' name2= 'Alquliti'/>
            <File name = 'Saud' name2= 'Gharbi'/>
            </div>
        )
    }

}
export default App ;
